import React, { useState } from "react";
import { Menu } from "antd";
import {
  AppstoreOutlined,
  SettingOutlined,
  UserOutlined,
  UserAddOutlined,
  LogoutOutlined,
} from "@ant-design/icons";
import { Link } from "react-router-dom"
import firebase from "firebase"
import { useDispatch } from "react-redux"
import { useNavigate } from "react-router-dom"

const { SubMenu, Item } = Menu;

const Header = () => {
  const [current, setCurrent] = useState("home")
  let dispatch = useDispatch();
  let navigate = useNavigate()

  const handleClick = (e) => {
    // console.log(e.key);
    setCurrent(e.key);
  }

  const logout = () => {
    firebase.auth().signOut();
    dispatch({
      type: "LOGOUT",
      payload: null,
    });
    history.push("/login");
  }

  return (
    <Menu onClick={handleClick} selectedKeys={[current]} mode="horizontal">
      <Item key="home" icon={<AppstoreOutlined />} className='text-primary'>
        <Link to="/" className='text-success'>Home</Link>
      </Item>

      <Item key="register" icon={<UserAddOutlined />} className="float-right text-primary">
        <Link to="/register" className='text-success'>Register</Link>
      </Item>

      <Item key="login" icon={<UserOutlined />} className="float-right text-primary">
        <Link to="/login" className='text-success'>Login</Link>
      </Item>

      <SubMenu icon={<SettingOutlined />} className='text-primary' title="UserName">
        <Item key="setting:1">Option 1</Item>
        <Item key="setting:2">Option 2</Item>
        <Item icon={<LogoutOutlined />} onClick={logout}>
          Logout
        </Item>
      </SubMenu>
    </Menu>
  );
};

export default Header;
